import{b as s}from"./app.64a015cf.js";const a={},n=s('<p>Plugins são como asdf sabe lidar com diferentes ferramentas, tais quais Node.js, Ruby, Elixir etc.</p><p>Seja em <a href="/pt-br/plugins-create">Criar Plugins</a> para usar API de plugin e ter suporte as ferramentas.</p><h2 id="adicionar" tabindex="-1"><a class="header-anchor" href="#adicionar" aria-hidden="true">#</a> Adicionar</h2><p>Adicione os plugins via sua Url Git:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin add </span><span style="color:#F92672;">&lt;</span><span style="color:#F8F8F2;">name</span><span style="color:#F92672;">&gt;</span><span style="color:#F8F8F2;"> </span><span style="color:#F92672;">&lt;</span><span style="color:#F8F8F2;">git-url</span><span style="color:#F92672;">&gt;</span></span>\n<span class="line"><span style="color:#88846F;"># asdf plugin add elm https://github.com/vic/asdf-elm</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>ou pelo nome abreviado dentro do repositório de plugins:</p><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin add </span><span style="color:#F92672;">&lt;</span><span style="color:#F8F8F2;">name</span><span style="color:#F92672;">&gt;</span></span>\n<span class="line"><span style="color:#88846F;"># asdf plugin add erlang</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>Ao criar scripts, prefira o método mais longo <code>git-url</code>, pois ele é independente do repositório de nome abreviado.</p><h2 id="listar-instalados" tabindex="-1"><a class="header-anchor" href="#listar-instalados" aria-hidden="true">#</a> Listar Instalados</h2><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin list</span></span>\n<span class="line"><span style="color:#88846F;"># asdf plugin list</span></span>\n<span class="line"><span style="color:#88846F;"># java</span></span>\n<span class="line"><span style="color:#88846F;"># nodejs</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin list --urls</span></span>\n<span class="line"><span style="color:#88846F;"># asdf plugin list</span></span>\n<span class="line"><span style="color:#88846F;"># java            https://github.com/halcyon/asdf-java.git</span></span>\n<span class="line"><span style="color:#88846F;"># nodejs          https://github.com/asdf-vm/asdf-nodejs.git</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br><span class="line-number">3</span><br><span class="line-number">4</span><br></div></div><h2 id="listar-todos-nomes-abreviados-no-repositorio" tabindex="-1"><a class="header-anchor" href="#listar-todos-nomes-abreviados-no-repositorio" aria-hidden="true">#</a> Listar todos nomes abreviados no repositório</h2><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin list all</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>Veja Todos os plugins(/pt-br/plugins-all) para os nomes abreviados dos plugins.</p><h2 id="atualizar" tabindex="-1"><a class="header-anchor" href="#atualizar" aria-hidden="true">#</a> Atualizar</h2><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin update --all</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>Se você quiser atualizar um pacote específico, apenas use.</p><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin update </span><span style="color:#F92672;">&lt;</span><span style="color:#F8F8F2;">name</span><span style="color:#F92672;">&gt;</span></span>\n<span class="line"><span style="color:#88846F;"># asdf plugin update erlang</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>Esta atualização irá buscar o último <em>commit</em> na <em>branch</em> padrão no <em>origin</em> de seu respositório. Plugins e atualizações das versões estão sendo desenvolvidas - https://github.com/asdf-vm/asdf/pull/916</p><h2 id="remover" tabindex="-1"><a class="header-anchor" href="#remover" aria-hidden="true">#</a> Remover</h2><div class="language-bash ext-sh line-numbers-mode"><pre class="shiki" style="background-color:#272822;"><code><span class="line"><span style="color:#F8F8F2;">asdf plugin remove </span><span style="color:#F92672;">&lt;</span><span style="color:#F8F8F2;">name</span><span style="color:#F92672;">&gt;</span></span>\n<span class="line"><span style="color:#88846F;"># asdf plugin remove erlang</span></span>\n<span class="line"></span></code></pre><div class="line-numbers"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><p>Removendo o plugin irá remover todas as instalações feitas com o plugin. Isso pode ser usado como um atalho para apagar/remover sujeiras de versões não utilizadas de uma ferramenta.</p><h2 id="sincronizar-nome-abreviado-no-repositorio" tabindex="-1"><a class="header-anchor" href="#sincronizar-nome-abreviado-no-repositorio" aria-hidden="true">#</a> Sincronizar nome abreviado no repositório</h2><p>O nome abreviado do repositório é sincronizado em seu máquina local e periodicamente atualizado. Esse período pode ser determinado com o seguinte método:</p><ul><li>comandos <code>asdf plugin add &lt;name&gt;</code> ou <code>asdf plugin list all</code> disparam a sincronização</li><li>ocorre uma sincronização se não houver nenhuma nos últimos <code>X</code> minutos</li><li><code>X</code> por padrão é <code>60</code>, mas pode ser mudado em <code>.asdfrc</code> via as opções do <code>plugin_repository_last_check_duration</code>. Seja mais em <a href="/pt-br/core-configuration">asdf documentação de configuração</a>.</li></ul>',25);a.render=function(s,a){return n};export default a;
